import React from "react";
import Link from "next/link";

const Nav = (props) => {
  const { title, link, description, image } = props.feed;
  return (
    <nav className="text-center">
      <ul className="flex justify-between px-4 my-4 py-1">
        <li className="flex px-2 py-1">
          <Link href="/">
            <a className="text-blue-500	no-underline text-sm">Home</a>
          </Link>
        </li>

        <li className="flex px-2 py-1">
          <a target="_blank" href={link} className="text-blue-500	no-underline text-sm">
            <p>{title}</p>
            <p>{props.feed.description}</p>
          </a>
        </li>

        <li className="flex px-2 py-1">
          <Link href="https://github.com/imboss712">
            <a className="text-blue-500	no-underline text-sm">Code</a>
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
